from __future__ import print_function

class Card():
    def __init__(self, val, prev):
        self.val = val
        self.prev = prev

def patience_sort(seq):
    for i, val in enumerate(seq):
        card_placed = False

        if i == 0:
            piles = [[Card(val, None)]]
            card_placed = True
            continue

        for j, pile in enumerate(piles):
            top_card = pile[-1]
            if val < top_card.val:
                # put this card on top
                if j == 0:
                    prev = None
                else:
                    prev = piles[j - 1][-1]

                piles[j].append(Card(val, prev))
                card_placed = True
                break

        if not card_placed:
            piles.append([Card(val, piles[-1][-1])])

    # backtrack to get sequence
    this_card = piles[-1][-1]
    seq = []
    while this_card is not None:
        seq.insert(0, this_card.val)
        this_card = this_card.prev

    return seq

def longest_decreasing_subsequence(seq):
    seq.reverse()
    lis = patience_sort(seq)
    lis.reverse()
    seq.reverse()

    return lis
